import React, { Component } from 'react';
import './Card.css'
class Card extends Component{
	render(){
		const {img, name} = this.props;
		return (
				<div>
					<h1> BigMovies </h1>
					<div className = 'Card'>
						<img src = {img} alt = {name} />
						<div className = 'Title'>
							<h3>{this.props.name}</h3> 
						</div>
					</div>
				</div>	
			)
	}
}

export default Card;
